export default function Pagination({ rowsPerPage, totalRow }) {
    const pageNumber = [];
    const x = Math.ceil(totalRow / rowsPerPage)


    for (let i = 1; i <=x ; i++) {
        pageNumber.push(i);
    }
     console.log("total page is : ",pageNumber);

    return (
        <div className="pagination">
            {
                pageNumber.map(num => (
